import { Fragment } from 'react';
import { useParams, Route,BrowserRouter } from 'react-router-dom';

import Comments from '../components/comments/Comments';
import MyCom from '../components/MyCom';

const QuteDetail = () => {
  const params = useParams();

  return (
    <BrowserRouter><Fragment>
      <h1>Quote Detail Page</h1>
      <p>{params.quteid}</p>
      <Route path={`/qutes/${params.quteid}/comments`}>
        <Comments />
      </Route>
      <Route path={`/qutes/${params.quteid}/hamad`}>
        <MyCom></MyCom>
      </Route>
    
    </Fragment></BrowserRouter>
    
  );
};

export default QuteDetail;
